import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [prompt, setPrompt] = useState(
    "Bla Bla Bla"
  );

  const handleChange = (event) => {
    setPrompt(event.target.value)
  }
  return (
    <div>
      <form>
        <label>Enter prompt:
          <textarea value={prompt} onChange={handleChange} />
        </label>
      </form>
    </div>
  );
}

export default App;
